a1c3803a-f09e-4dd0-bc13-7f6a446cccb3	denver-roller-derby	Denver Roller Derby	Denver Roller Derby, originally known as the Denver Roller Dolls, was founded by twenty courageous skaters in December 2005.\r\n\r\nWe are a non-profit organization dedicated to developing and promoting the sport of roller derby, training skaters for local, national and inter-league competition, and strengthening the communities in which we live. \r\n\r\nDenver Roller Derby’s all-volunteer officiating crew is dedicated to making roller derby safe and fair for everyone. Officials work both on-skates as referees and off-skates as NSOs, or non-skating officials. They master the WFTDA rules, assess penalties, skate with speed and agility, keep score, time the game, and track the stats. We’re proud to have multiple WFTDA-certified officials as Fight Attendants. We offer frequent training opportunities to officials throughout the Front Range.\r\n\r\nAll DRD hosted events take place at [The Rollerdome](https://maps.app.goo.gl/NNLmrCnPS2iC94ZW8).\r\n\r\nFor any inquiries for the officiating staff, please email: [headofficials@denverrollerderby.org](mailto:headofficials@denverrollerderby.org)	DRD_Logo_white_SolidFill_trans_Trademarked.png	https://www.denverrollerderby.org/skaters-staff/officials	Denver, CO	t	America/Denver
a5fc90f2-c632-443d-afe3-4b49bf85c2bf	foco-roller-derby	Fort Collins Roller Derby	Founded in January 2006 by skaters, FoCo Roller Derby, originally known as FoCo Girls Gone Derby, is Northern Colorado’s first roller derby league. As a skater-owned and operated 501(c)3 nonprofit, FoCo Roller Derby is dedicated to promoting athleticism, sportsmanship, inclusion, and empowerment through the exciting sport of roller derby. The league features a competitive travel team, the Micro Bruisers, two spirited travel teams, The Brew Crew and The Taphouse Titans and two recreational home teams, the Ale Marys and the Growlers.		https://focorollerderby.org/	Fort Collins, CO	t	America/Denver
